import * as types from "../../actionTypes";
import Lu_AddressTypeApi from "../../../api/Lu_AddressTypeApi";

let actionsFunction = {

  //CRUD METHODS

  // Create lu_addresstype
  createLu_AddressType: function(lu_addresstype) {
    return function(dispatch) {
      return Lu_AddressTypeApi
        .createLu_AddressType(lu_addresstype)
        .then(lu_addresstype => {
          dispatch(actionsFunction.createLu_AddressTypeSuccess(lu_addresstype));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  createLu_AddressTypeSuccess: function(lu_addresstype) {
    return { type: types.CREATE_LU_ADDRESSTYPE_SUCCESS, payload: lu_addresstype };
  },


  // Delete lu_addresstype
  deleteLu_AddressType: function(id) {
    return function(dispatch) {
      return Lu_AddressTypeApi
        .deleteLu_AddressType(id)
        .then(lu_addresstype => {
          dispatch(actionsFunction.deleteLu_AddressTypeSuccess(lu_addresstype));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  deleteLu_AddressTypeSuccess: function(lu_addresstype) {
    return { type: types.DELETE_LU_ADDRESSTYPE_SUCCESS, payload: lu_addresstype };
  },


  // Get lu_addresstype
  loadLu_AddressType: function(id) {
    return function(dispatch) {
      return Lu_AddressTypeApi
        .getOneLu_AddressType(id)
        .then(lu_addresstype => {
          dispatch(actionsFunction.loadLu_AddressTypeSuccess(lu_addresstype));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadLu_AddressTypeSuccess: function(lu_addresstype) {
    return { type: types.GET_LU_ADDRESSTYPE_SUCCESS, payload: lu_addresstype };
  },

  // Load  list
  loadLu_AddressTypeList: function() {
    return function(dispatch) {
      return Lu_AddressTypeApi
        .getLu_AddressTypeList()
        .then(list => {
          dispatch(actionsFunction.loadLu_AddressTypeListSuccess(list));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadLu_AddressTypeListSuccess: function(list) {
    return { type: types.LIST_LU_ADDRESSTYPE_SUCCESS, payload: list };
  },

	
  // Save lu_addresstype
  saveLu_AddressType: function(lu_addresstype) {
    return function(dispatch) {
      return Lu_AddressTypeApi
        .saveLu_AddressType(lu_addresstype)
        .then(lu_addresstype => {
          dispatch(actionsFunction.saveLu_AddressTypeSuccess(lu_addresstype));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  saveLu_AddressTypeSuccess: function(lu_addresstype) {
    return { type: types.UPDATE_LU_ADDRESSTYPE_SUCCESS, payload: lu_addresstype };
  },


};

export default actionsFunction;
